import React from "react";
import { Box, Button } from "@mui/material";

const UploadPhotoCardHover = ({formData, setFormData}) =>{
      return(
            <Box sx={{
                  width: 220,
                  height: 220,
                  position: 'absolute',
                  top: 0,
                  left: 0
            }}>
                  <img width={220} height={220} src={formData.uploadedPhotos.slice(-1)} alt="uploadedPhoto" />
                  <IconButton color="primary" aria-label="upload picture" component="label">
                        <input hidden accept="image/*" type="file" />
                        <PhotoCamera />
                        </IconButton>
            </Box>
      );
}

export default UploadPhotoCardHover;
